Nodes can accept a before_parent attribute, which is an action that runs before the parent. It can be used to provide a Score for each child. Here's an example of an action that always sets its score to Pass. Other options are Fail or Weight(u32) #[action]
fn score_always_pass<Node: AiNode>(query: Query<&mut Prop<Score, Node>>){ for state in query.iter_mut(){ **state = Score::Pass; }
} This tree will skip child1 and run child2: #[tree_builder]
pub fn MyTree() -> impl AiNode { tree! { <highest_score> <child1 before_parent=score_always_fail/> <child2 before_parent=score_always_pass/> </highest_score> }
} It would produce the following system ordering: graph LR; edgeA --&gt; selector; edgeB --&gt; selector; selector -- skips --- nodeA; selector -- runs --- nodeB; selector[highest_score] edgeA[score_always_fail] edgeB[score_always_pass] nodeA[child1] nodeB[child2] Actions that determine scores are sometimes referred to as considerations , conditions, filters, or scorers. It can also be helpful to think of them as the edges of child nodes when creating a diagram: graph TB; highest_score -- score_always_fail --- child1; highest_score -- score_always_pass --- child2;

